sys_variable_value.value:
answer = ifScript();

function ifScript() {
	var retVal = "no";
	var gr = new GlideRecord("x_norca_med_cam_claim_document");
	gr.addQuery( "case_ref", current.getUniqueValue());
	gr.addQuery( "referenced_table", current.getTableName());
	gr.addEncodedQuery( "ir_load_status!=not_requested" );
	gr.query();
	var total = gr.getRowCount(), fail = 0, success = 0;
	while (gr.next()) {
		switch(gr.getValue("ir_load_status")) {
			case "failed":
				fail++;
				break;
			case "complete":
				success++;
				break;
		}
	}
	
	if (total == (success + fail)) {
		var caseDocLoader = new x_norca_med_cam.cam_CaseDocumentLoader();
		if (fail>0) {
			caseDocLoader.updateTrackerForCase(current, null, "failed", total, success, fail);
		} else {
			caseDocLoader.updateTrackerForCase(current, null, "complete", total, success, fail);
		}
		answer = "yes";
	}
}

